INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES (1, 1052501040, 11, 105211, 0, "", 6, 1, 0, "素敵なケーキをありがとう！\nまさかこんな盛大に\nお祝いしてもらえるなんて\n思わなかったわ！", 1052501);
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES ("", 1052501041, 91, 0, "", "", "", "", "", "", 1052501);
