INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES (1, 1052501043, 11, 105211, 0, "", 6, 1, 0, "おめでとうって言ってもらえるだけでも\nうれしいのに、手作りのケーキまで……\n私、あなたにいろんなものを\nもらってばっかりね。", 1052501);
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES ("", 1052501044, 91, 0, "", "", "", "", "", "", 1052501);
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES ("", 1052501045, 21, "vo_adv_1052501", "", "", 0, 0, "", "vo_adv_1052501_002", 1052501);
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES (1, 1052501046, 11, 105211, 0, "", 5, 1, 0, "少しでもお返ししたいけど……\nあなたは何かしてほしいことはある？\nえ？　私の誕生日だから私が\n喜んでくれたらうれしい……？", 1052501);
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES ("", 1052501047, 91, 0, "", "", "", "", "", "", 1052501);
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES ("", 1052501048, 21, "vo_adv_1052501", "", "", 0, 0, "", "vo_adv_1052501_003", 1052501);
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES (1, 1052501049, 11, 105211, 0, "", 5, 1, 0, "私、もう十分に喜んでるわ！\nでも、あなたのそんな言葉を聞いたら\nもう少しわがままを\n言いたくなっちゃうわ。", 1052501);
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES ("", 1052501050, 91, 0, "", "", "", "", "", "", 1052501);
INSERT INTO `v1_f3b5fc8bcc36c9c9b1fa46f83e0267367dc98a521141744b7e55cee2deea65f5` VALUES ("", 1052501051, 21, "vo_adv_1052501", "", "", 0, 0, "", "vo_adv_1052501_004", 1052501);
